css:
.github-DialogPrompt {
  margin: 16px;
  text-align: center;
  font-size: 1.2em;
}
.github-DialogInputs {
  display: flex;
  flex-direction: column;
  padding: 8px;
}
.github-DialogLabel {
  flex: 1;
  margin: 8px;
  line-height: 2;
}
.github-DialogButtons {
  display: flex;
  align-items: center;
  justify-content: flex-end;
  padding: 8px;
}
.platform-win32 .github-DialogButtons {
  flex-direction: row-reverse;
  justify-content: flex-start;
}
.github-DialogButtons .btn {
  margin: 8px;
}
.github-DialogButtons-leftItem,
.github-DialogButtons-leftItem.btn {
  margin: 8px;
  margin-right: auto;
}
.github-DialogSpinner {
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 16px;
}
.github-DialogSpinner .loading {
  margin: 16px;
}
.github-Dialog atom-text-editor[mini].editor {
  margin: 0;
}
